import './lessons.css';
import { ILesson } from '../../models';

interface LessonsProps {
    lesson: ILesson
}

export function Lessons(props: LessonsProps) {
    return (
        <div id="lessons">
            <div className='lesson'>
                Lesson {props.lesson.id}.<br /> {props.lesson.title}
            </div>
        </div>    
    )
}
